import { createRouter, createWebHistory } from 'vue-router';
import Dashboard from './views/Dashboard.vue';
import ExamManagement from './views/ExamManagement.vue';
import QuestionManagement from './views/QuestionManagement.vue';

const routes = [
  { path: '/', redirect: '/dashboard' },
  { path: '/dashboard', component: Dashboard },
  { path: '/exam-management', component: ExamManagement },
  { path: '/question-management', component: QuestionManagement },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
